import React from 'react';
import "./css/discover.css";


function Discover() {
    return (
        <div>
            <div className="discover_cards">
                <div >
                <img className="discover_card1" src="https://images-static.nykaa.com/tr:w-560,c-at_max/uploads/9993ebb8-e8e0-4432-85ac-320494037006.jpg" />
                </div>
                <div className="discover_card2">
                <img src="https://images-static.nykaa.com/tr:w-560,c-at_max/uploads/9993ebb8-e8e0-4432-85ac-320494037006.jpg" />
                </div>
            </div>
            <div className="discover_card3">
            <img src="https://images-static.nykaa.com/tr:w-560,c-at_max/uploads/9993ebb8-e8e0-4432-85ac-320494037006.jpg" />
            </div>
        </div>
    )
}

export default Discover
